INSERT INTO `stocks` (`StockID`, `Ticker`, `name`, `Company`, `Price`, `Volume`, `Description`, `Time`) VALUES
(40, 'GOOG', 'google', 'Google Inc.', '830.63', 942218, 'Google Inc., a technology company, builds products and provides services to organize the information. The company offers Google Search, which provides information online; Google Now that offers information to users when they need it; AdWords, an auction-based advertising program; AdSense, which enables Websites that are part of the Google network to deliver ads; DoubleClick Ad Exchange, a marketplace for the trading display ad space; and other advertising platforms, such as AdExchange and AdMob. It also offers YouTube that offers video, interactive, and other ad formats; Android, an open source mobile software platform; hardware products, including Chromebook, Chrome OS devices, Chromecast, and Nexus devices; Google Play, a cloud-based digital entertainment store for apps, music, books, and movies; Google Drive, a place for users to create, share, collaborate, and keep their stuff; and Google Wallet, a virtual wallet for in-store contactless payments. In addition, the company provides Google Apps, which include Gmail, Docs, Slides, Drawings, Calendar, Sheets, Forms, Sites, etc. for people to work anywhere, anytime, on any device without loss of security or control; Google Maps Application Programming Interface; and Google Earth Enterprise, a software solution for imagery and data visualization. Further, it offers Google+ to share things online with people; Groups to create mailing lists and discussion groups; Blogger to share the life online with a blog; and Hangouts for group conversations. Additionally, Google provides App Engine, a platform as a service offering; Google Cloud Storage; Google BigQuery for real time analytics; Google Cloud SQL to store and manage data using a relational MySQL database; Google Compute Engine, an infrastructure as a service platform; and Google Developers to find all Google developer documentation, resources, events, and products. Google Inc. was founded in 1998 and is headquartered in Mountain View, California.', 1488501559),
(45, 'YHOO', 'yahoo', 'Yahoo Inc.', '45.94', 7017056, 'Yahoo Inc. Yahoo is a global technology company. Through the Companys technology and insights Yahoo delivers digital content and experiences across devices and globally. The Company provides online properties and services Yahoo Properties to users as well as a range of marketing services designed to reach and connect with those users on Yahoo and through a distribution network of third-party entities Affiliates. These Affiliates integrate its advertising offerings into their Websites or other offerings those Websites and other offerings Affiliate sites. Effective January 7 2014 Yahoo Inc acquired Aviate. Effective January 24 2014 Yahoo Inc acquired Cloud Party Inc. In February 2014 Yahoo Inc announced the expansion of its Champaign IL technology hub. Effective February 11 2014 Yahoo Inc acquired Wander LLC. Effective February 14 2014 Yahoo Inc acquired Distill. ', 1488501559),
(46, 'FB', 'facebook', 'Facebook, Inc.', '136.76', 12292251, 'Facebook Inc. Facebook is engaged in building products to create utility for users developers and advertisers. People use Facebook to stay connected with their friends and family to discover what is going on in the world around them and to share and express what matters to them to the people they care about. Developers can use the Facebook Platform to build applications and Websites that integrate with Facebook to reach its global network of users and to build personalized and social products. It offers advertisers a combination of reach relevance social context and engagement. In September 2013 Mail.Ru Group Limited sold its remaining interest in Facebook Inc. Effective September 25 2013 Facebook Inc acquired Mobile Technologies a developer of online applications. In October 2013 Facebook Inc acquired Onavo Inc. Effective January 8 2014 Facebook Inc acquired Little Eye Software Labs Pvt Ltd. Effective January 13 2014 Facebook Inc acquired Branch Media Inc. ', 1488501559),
(62, 'TWTR', 'twitter', 'Twitter, Inc. Com', '15.79', 12399569, 'Twitter Inc. Twitter is a global platform for public self-expression and conversation in real time. Twitter is a real-time platform where any user can create a Tweet and any user can follow other users. Each Tweet is limited to 140 characters of text but can also contain rich media including photos videos and applications. Viewers can see photos videos and conversations directly in Tweets to get the whole story at a glance and all in one place. The Company offers Twitter apps for phones tablets and computers. The Company generates its advertising revenue primarily from the sale of its three Promoted Products Promoted Tweets Promoted Accounts and Promoted Trends. Its users include millions of people from around the world as well as influential individuals and organizations such as government officials celebrities athletes journalists sports teams media outlets and brands. In April 2014 Twitter Inc acquired Gnip Inc. ', 1488501559),
(66, 'MSFT', 'microsoft', 'Microsoft Corpora', '64.01', 24537625, 'Microsoft Corporation is engaged in developing licensing and supporting a range of software products and services. The Company operates in five segments Windows  Windows Live Division Windows Division Server and Tools Online Services Division OSD Microsoft Business Division MBD and Entertainment and Devices Division EDD. The Companys products include operating systems for personal computers PCs servers phones and other intelligent devices server applications for distributed computing environments productivity applications business solution applications desktop and server management tools software development tools video games and online advertising. In September 2013 Ericsson completed the acquisition of Microsofts Mediaroom business and TV solution. Effective October 23 2013 Microsoft Corp acquired Apiphany Inc. Effective February 4 2014 Microsoft Corp acquired an undisclosed stake in Foursquare Labs Inc. ', 1488501559);
